script: |
  super -f text -I q1636.spq | sort > q1636.out

inputs:
  - name: q1636.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT ( - col0 + + + col1 ) BETWEEN ( NULL ) AND + - 46 * 54 + - col0 * col0;
  - name: tab2

outputs:
  - name: q1636.out
    data: |
      46	51	23
      64	77	40
      75	67	58
